/////parameter
function filterProduct(value) {
    var buttons=document.querySelectorAll(".button-value");
    buttons.forEach((button) => 
    {
        if(value.toUpperCase() == button.innerText.toUpperCase()){
            button.classList.add("active");
        }
        else{
            button.classList.remove("active");
        }
    });

// Select all cards
var elements=document.querySelectorAll(".card");
elements.forEach((element) => {
    if(value == "all") {
        element.classList.remove("hide");   
    }
    else{
        if(element.classList.contains(value)) {
            element.classList.remove("hide");
        }
        else{
            element.classList.add("hide");
            
        }
    }
});
}


//  js for search item
document.querySelector(".sbutton").addEventListener("click", () => {
    var searchInput =document.getElementById("searchbar").value;
    console.log(searchInput);
    var elements = document.querySelectorAll(".product-name");
    console.log(elements);
    var cards=document.querySelectorAll(".card");
    console.log(cards);
    elements.forEach((element, index) => {
            if (element.innerText.toUpperCase().includes(searchInput.toUpperCase())) {
                cards[index].classList.remove("hide");
            }
            else {
                cards[index].classList.add("hide");
                var nameprods=document.querySelector(".nameprod");
                nameprods.innerText=searchInput;
                nameprods.style.fontSize="30px";
                nameprods.style.fontWeight="bold";
                nameprods.style.marginTop="20px";
                nameprods.style.marginBottom="20px";
            }
        });
});

